-- title:  AntVania
-- author: Muhammad Fauzan
-- desc:   Game Off 2021
-- script: lua

scn=0--scene
zClick=false

p={--player
	hl=3,
}

function TIC()
	render()
end

function render()
	--title
	if scn==0 then
		sTitle()
	--game
	elseif scn==1 then
		sGame()
	end
end

function sTitle()
	map(66,17)
	rect(54,40,132,16,0)
	print("AntVania",54,41,3,false,3)
	print("AntVania",54,40,4,false,3)
	print("Game by MFauzan",92,60,14,false,1,true)
	if not zClick then
		if time()%1000>500 then
		 print("PRESS     TO START",74,98,14)
		 print("PRESS     TO START",74,97,12)
		 spr(188,109,96)
		end
		if btnp(4) then zClick=true end
	else
		local coC=14--continue color
		if pmem(0)>0 then coC=12 end
		spr(184,84,79)print("TO CONTINUE",96,80,coC)
		spr(185,84,95)print("TO NEW GAME",96,96,12)
		--continue
		if pmem(0)>0 and btnp(0) then scn=1 end
		--new game
		if btnp(1) then scn=1 end
	end
end

function sGame()
	map()hud()
end

function hud()
	h=p.hl*8
	--bg
	rect(0,0,240,14,0)
	--health
 for x=8,24,8 do spr(177,x,2,0) end
 for x=8,h,8 do spr(176,x,2,0) end
 --weapon
 spr(189,152,2,0)
 spr(178,160,2,0)
 spr(180,168,2,0)
 spr(179,176,2,0)
 --power
 spr(190,200,2,0)
 spr(178,208,2,0)
 spr(182,216,2,0)
 spr(179,224,2,0)
end
